{
  "translationLines": [
    {
      "lineNumber": 223612,
      "originalJapaneseLine": "　話に聞く限り、魔王ランスってのはやりまくりで、",
      "translatedEnglishLine": "From what I've heard, the Demon King Rance is quite the womanizer,"
    },
    {
      "lineNumber": 223613,
      "originalJapaneseLine": "　数百人はガキいてもおかしかねーぞ」",
      "translatedEnglishLine": "it wouldn't be surprising if he had hundreds of kids."
    },
    {
      "lineNumber": 223614,
      "originalJapaneseLine": "「うむ、実はまだ解明されてないことだが、",
      "translatedEnglishLine": "Indeed, though it's still not fully understood,"
    },
    {
      "lineNumber": 223615,
      "originalJapaneseLine": "　この世界では子供を授かるかどうかは、",
      "translatedEnglishLine": "in this world, whether one can have children"
    },
    {
      "lineNumber": 223616,
      "originalJapaneseLine": "　ある程度運命で決められているのだ」",
      "translatedEnglishLine": "is somewhat determined by fate."
    },
    {
      "lineNumber": 223617,
      "originalJapaneseLine": "「特定の相手……",
      "translatedEnglishLine": "With a specific partner..."
    },
    {
      "lineNumber": 223618,
      "originalJapaneseLine": "　運命の赤い糸が繋がった相手としか",
      "translatedEnglishLine": "only with the person connected by the red thread of fate"
    },
    {
      "lineNumber": 223619,
      "originalJapaneseLine": "　子供は授からない……そういう説がある」",
      "translatedEnglishLine": "can one have children... such is the theory."
    },
    {
      "lineNumber": 223620,
      "originalJapaneseLine": "「あの男はその運命の赤い糸が",
      "translatedEnglishLine": "That man apparently had those red threads of fate"
    },
    {
      "lineNumber": 223621,
      "originalJapaneseLine": "　両手両足に20本もあったらしい」",
      "translatedEnglishLine": "twenty of them on both his hands and feet."
    },
    {
      "lineNumber": 223622,
      "originalJapaneseLine": "「故に、子供も多くて20人というわけだ」",
      "translatedEnglishLine": "Therefore, he could have up to 20 children."
    },
    {
      "lineNumber": 223623,
      "originalJapaneseLine": "「まあ、仮説ではあるし……",
      "translatedEnglishLine": "Well, it's just a hypothesis, and..."
    },
    {
      "lineNumber": 223624,
      "originalJapaneseLine": "　20人も仲間にするのは無理だろうが……」",
      "translatedEnglishLine": "it seems impossible to have 20 companions..."
    },
    {
      "lineNumber": 223625,
      "originalJapaneseLine": "「えーと、今確かお父さんの子供達が……」",
      "translatedEnglishLine": "Uh, let's see, the current known children of the father are..."
    },
    {
      "lineNumber": 223626,
      "originalJapaneseLine": "「余の知る限り……」",
      "translatedEnglishLine": "As far as I know..."
    },
    {
      "lineNumber": 223627,
      "originalJapaneseLine": "「悪魔フェリスの子、",
      "translatedEnglishLine": "Child of the demon Felis,"
    },
    {
      "lineNumber": 223628,
      "originalJapaneseLine": "　長男であるダークランス」",
      "translatedEnglishLine": "the eldest son, Dark Rance."
    },
    {
      "lineNumber": 223629,
      "originalJapaneseLine": "「山本五十六の子、",
      "translatedEnglishLine": "Child of Yamamoto Isoroku,"
    },
    {
      "lineNumber": 223630,
      "originalJapaneseLine": "　JAPAN国主の山本乱義」",
      "translatedEnglishLine": "Yamamoto Rangyi, lord of JAPAN."
    },
    {
      "lineNumber": 223631,
      "originalJapaneseLine": "「カラー女王パステルの子、",
      "translatedEnglishLine": "Child of the Color Queen Pastel,"
    },
    {
      "lineNumber": 223632,
      "originalJapaneseLine": "　シャングリラ外交官にしてカラーの姫、",
      "translatedEnglishLine": "Shangri-La's diplomat and Color princess,"
    },
    {
      "lineNumber": 223633,
      "originalJapaneseLine": "　リセット・カラー」",
      "translatedEnglishLine": "Reset Color."
    },
    {
      "lineNumber": 223634,
      "originalJapaneseLine": "「リーザス女王、リア・パラパラ・リーザスの子、",
      "translatedEnglishLine": "Child of Queen Lisas, Ria Parapara Lisas,"
    },
    {
      "lineNumber": 223635,
      "originalJapaneseLine": "　赤の軍将軍にしてリーザス王子、",
      "translatedEnglishLine": "General of the Red Army and Prince of Lisas,"
    },
    {
      "lineNumber": 223636,
      "originalJapaneseLine": "　ザンス・リーザス」",
      "translatedEnglishLine": "Zans Lisas."
    },
    {
      "lineNumber": 223637,
      "originalJapaneseLine": "「ゼス王マジック・ザ・ガンジーの子、",
      "translatedEnglishLine": "Child of King Xess Magic the Gandhi,"
    },
    {
      "lineNumber": 223638,
      "originalJapaneseLine": "　ゼスの姫、スシヌ・ザ・ガンジー」",
      "translatedEnglishLine": "Xess princess, Sushinu the Gandhi."
    },
    {
      "lineNumber": 223639,
      "originalJapaneseLine": "「徳川千姫の子、",
      "translatedEnglishLine": "Child of Tokugawa Senhime,"
    },
    {
      "lineNumber": 223640,
      "originalJapaneseLine": "　癒し巫女、徳川深根」",
      "translatedEnglishLine": "the healing priestess, Tokugawa Fukane."
    },
    {
      "lineNumber": 223641,
      "originalJapaneseLine": "「毛利てるの子、",
      "translatedEnglishLine": "Child of Mouri Teru,"
    },
    {
      "lineNumber": 223642,
      "originalJapaneseLine": "　毛利家跡継ぎ、毛利元就」",
      "translatedEnglishLine": "heir to the Mouri family, Mouri Motonari."
    },
    {
      "lineNumber": 223643,
      "originalJapaneseLine": "「余の子、",
      "translatedEnglishLine": "My own child,"
    },
    {
      "lineNumber": 223644,
      "originalJapaneseLine": "　一介の医師、ミックス・トー」",
      "translatedEnglishLine": "a mere doctor, Mix Toe."
    },
    {
      "lineNumber": 223645,
      "originalJapaneseLine": "「ヘルマン大統領シーラ・ヘルマンの子、",
      "translatedEnglishLine": "Child of President Helman, Sheila Helman,"
    },
    {
      "lineNumber": 223646,
      "originalJapaneseLine": "　レリコフ・ヘルマン」",
      "translatedEnglishLine": "Lerikov Helman."
    },
    {
      "lineNumber": 223647,
      "originalJapaneseLine": "「見当かなみの子、",
      "translatedEnglishLine": "Child of Kanami Kentou,"
    },
    {
      "lineNumber": 223648,
      "originalJapaneseLine": "　野良忍者、見当ウズメ」",
      "translatedEnglishLine": "the rogue ninja, Kentou Uzume."
    },
    {
      "lineNumber": 223649,
      "originalJapaneseLine": "「リーザス親衛隊指南役チルディ・シャープの子、",
      "translatedEnglishLine": "Child of Lisas royal guard instructor, Childy Sharp,"
    },
    {
      "lineNumber": 223650,
      "originalJapaneseLine": "　アーモンド・シャープ」",
      "translatedEnglishLine": "Almond Sharp."
    },
    {
      "lineNumber": 223651,
      "originalJapaneseLine": "「そして、法王クルックー・モフスの子、",
      "translatedEnglishLine": "And child of the Pontiff Krukku Mofus,"
    },
    {
      "lineNumber": 223652,
      "originalJapaneseLine": "　＜エール＞・モフス」",
      "translatedEnglishLine": "<Aile> Mofus."
    },
    {
      "lineNumber": 223653,
      "originalJapaneseLine": "「分かっているだけでこの計12名だ」",
      "translatedEnglishLine": "As far as we know, that's a total of 12 people."
    },
    {
      "lineNumber": 223654,
      "originalJapaneseLine": "「ふっ、法王に子供がいるなど、",
      "translatedEnglishLine": "Hmph, I only recently learned even I that the Pontiff has children."
    },
    {
      "lineNumber": 223655,
      "originalJapaneseLine": "　余ですら知ったのは最近のこと。",
      "translatedEnglishLine": "It seems that the Color princess knew earlier than I did."
    },
    {
      "lineNumber": 223656,
      "originalJapaneseLine": "　そこなカラーの姫は知っていたようだがな」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 223657,
      "originalJapaneseLine": "「えへへ……」",
      "translatedEnglishLine": "Hehe..."
    },
    {
      "lineNumber": 223658,
      "originalJapaneseLine": "「他にも余ですら知らぬ子は",
      "translatedEnglishLine": "There may be some children even I do not know of."
    },
    {
      "lineNumber": 223659,
      "originalJapaneseLine": "　何名かいるかも知れんがな」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 223660,
      "originalJapaneseLine": "「部下だ」",
      "translatedEnglishLine": "They are my subordinates."
    },
    {
      "lineNumber": 223661,
      "originalJapaneseLine": "「余が世界を手に入れる時、",
      "translatedEnglishLine": "When I obtain the world,"
    },
    {
      "lineNumber": 223662,
      "originalJapaneseLine": "　その景色を最も傍で見せると約束した、",
      "translatedEnglishLine": "I promised to let them see that scenery closest by my side."
    },
    {
      "lineNumber": 223663,
      "originalJapaneseLine": "　余にとって大事な右腕よ」",
      "translatedEnglishLine": "They are an important right arm to me."
    },
    {
      "lineNumber": 223664,
      "originalJapaneseLine": "「アア？　世界を手に入れるだぁ？」",
      "translatedEnglishLine": "Huh? Obtain the world?"
    },
    {
      "lineNumber": 223665,
      "originalJapaneseLine": "「……聞き捨てならないですね」",
      "translatedEnglishLine": "...That's something I can't just ignore."
    },
    {
      "lineNumber": 223666,
      "originalJapaneseLine": "「クク……",
      "translatedEnglishLine": "Heh heh..."
    },
    {
      "lineNumber": 223667,
      "originalJapaneseLine": "　よいなぁ、お前らは」",
      "translatedEnglishLine": "You guys, huh,"
    },
    {
      "lineNumber": 223668,
      "originalJapaneseLine": "「この余を相手に一歩も引かぬは、",
      "translatedEnglishLine": "standing your ground against me without backing down,"
    },
    {
      "lineNumber": 223669,
      "originalJapaneseLine": "　蛮勇ではあるが……余は好きだぞ」",
      "translatedEnglishLine": "is foolish bravery... but I like it."
    },
    {
      "lineNumber": 223670,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "............"
    },
    {
      "lineNumber": 223671,
      "originalJapaneseLine": "「こいつ、反抗すればするほど、",
      "translatedEnglishLine": "The more this guy resists,"
    }
  ]
}

